"text12">do to stop the creature:</text><text x="121.839px" y="642.1px" style="font-family:'Arial-BoldMT', 'Arial', sans-serif;font-weight:700;font-size:36px;fill:#fff;" id="text14">Recover and archive all</text><text x="87.895px" y="679.277px" style="font-family:'Arial-BoldMT', 'Arial', sans-serif;font-weight:700;font-size:36px;fill:#fff;" id="text16">English-speaking countries</text><text x="72.893px" y="716.455px" style="font-family:'Arial-BoldMT', 'Arial', sans-serif;font-weight:700;font-size:36px;fill:#fff;" id="text18">with their incredible heritage.</text></g><g transform="matrix(1,0,0,1,10.6359,1055.57)" id="g36"><text x="65.901px" y="507.744px" style="font-family:'ArialMT', 'Arial', sans-serif;font-size:36px;fill:#fff;" id="text24">T<tspan x="83.901px 103.923px " y="507.744px 507.744px " id="tspan22">ak</tspan>e your last page of your</text><text x="65.901px" y="544.922px" style="font-family:'ArialMT', 'Arial', sans-serif;font-size:36px;fill:#fff;" id="text28">notebook. <tspan x="233.386px 255.376px " y="544.922px 544.922px " id="tspan26">Th</tspan>ere you’ll ﬁnd</text><text x="65.901px" y="582.1px" style="font-family:'ArialMT', 'Arial', sans-serif;font-size:36px;fill:#fff;" id="text30">a list of features your team</text><text x="65.901px" y="619.277px" style="font-family:'ArialMT', 'Arial', sans-serif;font-size:36px;fill:#fff;" id="text32">should investigate to</text><text x="65.901px" y="656.455px" style="font-family:'ArialMT', 'Arial', sans-serif;font-size:36px;fill:#fff;" id="text34">defeat the creature.</text></g><g transform="matrix(1,0,0,1,306.292,1512.89)" id="g48"><text x="65.901px" y="507.744px" style="font-family:'ArialMT', 'Arial', sans-serif;font-size:36px;fill:#fff;" id="text38">Complete that list and</text><text x="65.901px" y="544.922px" style="font-family:'ArialMT', 'Arial', sans-serif;font-size:36px;fill:#fff;" id="text40">then use the draft side</text><text x="65.901px" y="582.1px" style="font-family:'ArialMT', 'Arial', sans-serif;font-size:36px;fill:#fff;" id="text42">of the page to plan</text><text x="65.901px" y="619.277px" style="font-family:'ArialMT', 'Arial', sans-serif;font-size:36px;fill:#fff;" id="text44">how you’ll present the</text><text x="65.901px" y="656.455px" style="font-family:'ArialMT', 'Arial', sans-serif;font-size:36px;fill:#fff;" id="text46">country to the world.</text></g><g transform="matrix(1,0,0,1,-7.95797,2115.8)" id="g58"><text x="65.901px" y="507.744px" style="font-family:'ArialMT', 'Arial', sans-serif;font-size:36px;fill:#fff;" id="text50">After that, Detective Phillips</text><text x="65.901px" y="544.922px" style="font-family:'ArialMT', 'Arial', sans-serif;font-size:36px;fill:#fff;" id="text52">will let you know your last code</text><text x="65.901px" y="582.1px" style="font-family:'ArialMT', 'Arial', sans-serif;font-size:36px;fill:#fff;" id="text56">to reach the end of this story<tspan x="517.483px " y="582.1px " id="tspan54">.</tspan></text></g><g transform="matrix(1,0,0,1,144.771,1926.8)" id="g68"><text x="65.901px" y="507.744px" style="font-family:'ArialMT', 'Arial', sans-serif;font-size:36px;fill:#fff;" id="text62">T<tspan x="83.901px 103.923px " y="507.744px 507.744px " id="tspan60">ak</tspan>e the cardboard and be creative</text><text x="65.901px" y="544.922px" style="font-family:'ArialMT', 'Arial', sans-serif;font-size:36px;fill:#fff;" id="text64">and original to capture all you want</text><text x="65.901px" y="582.1px" style="font-family:'ArialMT', 'Arial', sans-serif;font-size:36px;fill:#fff;" id="text66">to show to your classmates.</text></g><clipPath id="_clip1"><rect x="0" y="0" width="800" height="410.503" id="rect70"/></clipPath><g clip-path="url(#_clip1)" id="g80"><clipPath id="_clip2"><rect x="0" y="0" width="800" height="410.503" id="rect73"/></clipPath><g clip-path="url(#_clip2)" id="g78"><use xlink:href="#_Image3" x="0" y="0" width="800px" height="410.503px" transform="matrix(1,0,0,0.998791,0,0)" id="use76"/></g></g><use xlink:href="#_Image4" x="0" y
